import React from "react";
import './MovieRow.css';

export default ({title, items}) => {
    return (
        <div>
            <h2>{title}</h2>
            <div className="movieRow--listarea">
            <img src="https://www.google.com/search?q=img&rlz=1C1SQJL_pt-BRBR866BR866&sxsrf=AJOqlzWTcWYQAMbb2mon7ezTp82U5qAGTg:1674587222843&source=lnms&tbm=isch&sa=X&ved=2ahUKEwjNpLvE8-D8AhWqrpUCHYlCB58Q_AUoAXoECAEQAw#imgrc=nJlIy554f6U0jM"></img>
            </div>
        </div>
 
 );
 
}
